const e=JSON.parse(`{"key":"v-7101117c","path":"/se/lang/java/JUC/async/future.html","title":"异步编程","lang":"en-US","frontmatter":{"description":"异步编程 Future 同步与异步的概念 同步 ： 发出一个调用之后，在没有得到结果之前， 该调用就不可以返回，一直等待。 异步 ：调用在发出之后，不用等待返回结果，该调用直接返回。 阻塞与非阻塞的概念 阻塞和非阻塞指的是：当前接口数据还未准备就绪时，线程是否被阻塞挂起。 何为阻塞挂起？就是当前线程还处于 CPU 时间片当中，调用了阻塞的方法，由于数据未准备就绪，则时间片还未到就让出 CPU。","head":[["meta",{"property":"og:url","content":"https://davidliuk.github.io/blog/blog/se/lang/java/JUC/async/future.html"}],["meta",{"property":"og:site_name","content":"David's Blog"}],["meta",{"property":"og:title","content":"异步编程"}],["meta",{"property":"og:description","content":"异步编程 Future 同步与异步的概念 同步 ： 发出一个调用之后，在没有得到结果之前， 该调用就不可以返回，一直等待。 异步 ：调用在发出之后，不用等待返回结果，该调用直接返回。 阻塞与非阻塞的概念 阻塞和非阻塞指的是：当前接口数据还未准备就绪时，线程是否被阻塞挂起。 何为阻塞挂起？就是当前线程还处于 CPU 时间片当中，调用了阻塞的方法，由于数据未准备就绪，则时间片还未到就让出 CPU。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2023-05-17T10:10:52.000Z"}],["meta",{"property":"og:locale","content":"en-US"}],["meta",{"property":"og:locale:alternate","content":"zh-CN"}],["meta",{"property":"article:modified_time","content":"2023-05-17T10:10:52.000Z"}],["link",{"rel":"alternate","hreflang":"zh-cn","href":"https://davidliuk.github.io/blog/blog/zh/se/lang/java/JUC/async/future.html"}]]},"headers":[{"level":2,"title":"Future","slug":"future","link":"#future","children":[{"level":3,"title":"同步与异步的概念","slug":"同步与异步的概念","link":"#同步与异步的概念","children":[]},{"level":3,"title":"阻塞与非阻塞的概念","slug":"阻塞与非阻塞的概念","link":"#阻塞与非阻塞的概念","children":[]},{"level":3,"title":"Future 的方法","slug":"future-的方法","link":"#future-的方法","children":[]}]},{"level":2,"title":"CompletableFuture","slug":"completablefuture","link":"#completablefuture","children":[]}],"git":{"createdTime":1677504602000,"updatedTime":1684318252000,"contributors":[{"name":"davidliuk","email":"l729641074@163.com","commits":2},{"name":"刘大维","email":"davidliu@liudaweideMacBook-Pro.local","commits":2}]},"readingTime":{"minutes":2.37,"words":712},"localizedDate":"February 27, 2023","filePathRelative":"se/lang/java/JUC/async/future.md","excerpt":"<h1> 异步编程</h1>\\n<h2> Future</h2>\\n<h3> 同步与异步的概念</h3>\\n<ul>\\n<li><strong>同步</strong> ： 发出一个调用之后，在没有得到结果之前， 该调用就不可以返回，一直等待。</li>\\n<li><strong>异步</strong> ：调用在发出之后，不用等待返回结果，该调用直接返回。</li>\\n</ul>\\n<h3> 阻塞与非阻塞的概念</h3>\\n<p>阻塞和非阻塞指的是：当前接口数据还未准备就绪时，线程是否被阻塞挂起。</p>\\n<p>何为阻塞挂起？就是当前线程还处于 CPU 时间片当中，调用了阻塞的方法，由于数据未准备就绪，则时间片还未到就让出 CPU。</p>","autoDesc":true}`);export{e as data};
